import React, { useState } from "react";
import '../../styles/colleges.css';

const CollegeCard = ({ college }) => {
  const [isExpanded, setIsExpanded] = useState(false);

  return (
    <div className="college-card">
      {/* College Image */}
      <img src={college.image} alt={college.name} />

      <h3>{college.name}</h3>

      {/* College Location with a link */}
      <p className="college-location">
        <a href={college.locationLink} target="_blank" rel="noopener noreferrer">
          {college.location}
        </a>
      </p>

      {/* Description */}
      <p>
        {isExpanded ? college.description : `${college.description.substring(0, 100)}...`}
        <span className="read-more" onClick={() => setIsExpanded(!isExpanded)}>
          {isExpanded ? " Read Less" : " Read More"}
        </span>
      </p>

      {/* Visit Website Button */}
      <button
        onClick={() => window.open(college.website, "_blank")}
        className="visit-button"
      >
        Visit Website
      </button>
    </div>
  );
};

const CollegeList = ({ colleges }) => {
  return (
    <div className="college-list">
      {colleges.map((college, index) => (
        <CollegeCard key={index} college={college} />
      ))}
    </div>
  );
};

